import React from "react";
import { Card } from "antd";
import {
  RetweetOutLined,
  HeartOutLined,
  MessageOutlined,
  EllipsisOutlined,
} from "@ant-design";

const PostCard = ({ post }) => {
  return (
    <>
      <Card
        cover={post.images[0] && <PostImages images={post.imges} />}
        action={[
          <RetweetOutLined />,
          <HeartOutLined />,
          <MessageOutlined />,
          <Popover>
            <EllipsisOutlined />
          </Popover>,
        ]}
      >
        <Image />
        <Content />
        <Button></Button>
      </Card>
      <CommentForm />
      <Comments />
    </>
  );
};

export default PostCard;
